importPackage(Packages.java.net);

function invoke(msg)         {            

	var client_id= msg.get("client_id");
	//var scopes =  msg.get("scopes");
	var response_type= msg.get("params.query.response_type");
	var state= msg.get("params.query.state");
	var redirect_uri= msg.get("params.query.redirect_uri");
	var host= msg.get("http.header.Host");
	var protocol=  msg.get("http.request.protocol");

//	scopes=  java.net.URLEncoder.encode(scopes  ,"UTF-8");
//	var requestUri=protocol+"://"+host+"/oauth/authorize?response_type="+response_type+"&state="+state+"&redirect_uri="+redirect_uri+"&client_id="+client_id+"&scope="+scopes;
	var requestUri=protocol+"://"+host+"/oauth/authorize?response_type="+response_type+"&state="+state+"&redirect_uri="+redirect_uri+"&client_id="+client_id;

    
	Trace.debug("requestUri : "+requestUri);
	msg.put("http.request.uri",  new java.net.URI(requestUri.toString() ));
	msg.put("message.uri",  new java.net.URI(requestUri.toString() ));
	msg.put("params.query.client_id",  client_id);

	return true;
 }

importPackage(Packages.java.security);
importPackage(Packages.com.vordel.trace);
importPackage(Packages.java.util);
importPackage(org.apache.commons.codec.binary.*);
importPackage (java.security.*);

function invoke(msg)         
{       
	//On rcupre le code_challenge et code_challenge_method dans le cache temporaire de la request authorize
	var codeChallenge = msg.get("codeChallenge");
	var codeChallengeMethod = msg.get("codeChallengeMethod");
       var codeVerifier = msg.get("params.query.code_verifier");
 	Trace.debug("codeChallenge:"+codeChallenge);
	Trace.debug("codeChallengeMethod:"+codeChallengeMethod );
	Trace.debug("codeVerifier :"+codeVerifier  );

	if (codeChallenge != null && codeChallenge !='') {
		 if ( codeChallengeMethod != null && codeChallengeMethod.equals("plain")  ) {
			  if(  codeVerifier != null && codeVerifier.equals(codeChallenge) ) { 
				return true ;
	   		  } else {
				return false;
	   		  }	 
		} else {

		      var sha256Digester = java.security.MessageDigest.getInstance("SHA-256");
	             sha256Digester.update(codeVerifier.getBytes("ISO_8859_1"));
       	      var digestBytes = sha256Digester.digest();
                    var controlCodeChallenge = org.apache.commons.codec.binary.Base64.encodeBase64URLSafeString(digestBytes);

  		     Trace.debug("controlCodeChallenge:"+controlCodeChallenge );

			if( controlCodeChallenge.equals(codeChallenge) ) { 
				return true ;
	   		  } else {
				return false;
	   		  }	 
		}
	}
	else{
		// Pas de codeChallenge dans la requete authorize d'origine
		return true;
	}        
}

