function invoke(msg)         {            

	var now, exp;
	
	now = new Date();	
	now =  now.getTime() ;
	// Expiration dans 10heures
	exp = now  + 36000 * 1000;
	
	//JWT : date exprim en secondes et non en millisecondes
	exp = Math.round(exp/1000);
	now = Math.round(now /1000);

	msg.put("now", now.toString());
	msg.put("expiration.time", exp.toString());

	return true;         
}

importPackage(Packages.com.vordel.trace);
function invoke(msg)         {            

try{
      var authHeader = msg.get("http.header.Authorization");
      var values = authHeader.split(" ");
      var encodedValue = values[1];
      Trace.debug("Base64-encoded Authorization Value: " + encodedValue);
      var decoded = com.vordel.common.base64.Decoder.decodeToString(encodedValue);
      var index = decoded.indexOf(':');
      var clientId = decoded.substring(0, index);
      msg.put("client_id", clientId);
      return true;         
     }
	 catch (e) {
		Trace.error(">>>Exception : " +e);
	return false;
  }
}

importPackage(Packages.com.vordel.trace);
importPackage(Packages.com.vordel.common.base64);

function invoke(msg)         {           

	var idToken = String(msg.get("params.query.id_token_hint"));
	Trace.debug(">>> idToken : " + idToken);

	var tokenParts = idToken.split(".");
	Trace.debug(">>> tokenParts : " + tokenParts[0]);
	Trace.debug(">>> tokenParts : " + tokenParts[1]);

	//PAD Base64
	var base64data = tokenParts[1];

    	while (base64data.length % 4 !== 0) {
      		base64data+= "=";
	}

	Trace.debug(">>> base64data : " + base64data);

	var claimsJson = Decoder.decodeToString(base64data);
	Trace.debug(">>> claimsJson : " + claimsJson);

	var claims = JSON.parse(claimsJson);

	var aud = claims.aud;
	var codeapp = claims.codeapp;

	Trace.debug(">>> aud : " + aud);
	Trace.debug(">>> codeapp : " + codeapp);

	msg.put("id.token.claim.aud",  aud);
	msg.put("codeApp",  codeapp.toLowerCase());

	return true;         
}

