function invoke(msg)         {         

	
	var roles = new java.util.ArrayList();
	//type java.util.ArrayList
	var listeHabilitationsFines= msg.get("iss.listeHabilitationsFines");
	
	if (typeof listeHabilitationsFines==='object' && listeHabilitationsFines!= null) {
		Trace.debug(listeHabilitationsFines);
		for ( i =0 ; i <listeHabilitationsFines.size() ; i++){
			var habilitation = listeHabilitationsFines.get(i);
			var idFonctionnelHFines = habilitation.get("idFonctionnelHFines");
			var valeurParDefaut =  habilitation.get("valeurParDefaut");
			idFonctionnelHFines=idFonctionnelHFines.replace("HF_B_PISP", "pisp").replace("HF_B_AISP", "aisp").replace("HF_B_PIISP", "piisp");
			Trace.debug(idFonctionnelHFines + ":" + valeurParDefaut );
			if(valeurParDefaut =="1"){
				roles.add("\""+idFonctionnelHFines+"\"" );
			}
		}
	}
	if (roles.size()>0){
		msg.put("iss.roles",roles);
		return true;
	}
	else{
		return false;
	}         
}

