importPackage(Packages.com.vordel.trace);
importPackage(Packages.java.util);

function invoke(msg) {    
	
	//Format de la plage horaire attendu
	var myRegex = new java.lang.String("([0-2][0-9])[H-h]([0-5][0-9])");
	
	//Rcupration du paramtrage contextuel
	// Dimanche : 1 plage par dfaut de 22h00  23h00
	
	// Dimanche
	var plageHoraireDimancheDebut1Indispo = msg.get("plage.horaire.dimanche.debut.indispo.1");
	var plageHoraireDimancheFin1Indispo = msg.get("plage.horaire.dimanche.fin.indispo.1");
	
    var plageHoraireDebut1Indispo;
    var plageHoraireFin1Indispo;

    // On dtermine le jour de la semaine et l'heure courante
    var calNow = new GregorianCalendar();

 	// 1. jour de la semaine
	var dayOfWeek = calNow.get(Calendar.DAY_OF_WEEK);
	//Trace.debug("dayOfWeek : " + dayOfWeek);
	
	// 2. on fixe les plages horaires d'indisponibilit selon l'algo suivant :
	// plage de fermeture programme pour CPF : dimanche de 22h00  23h00	

	if (dayOfWeek == Calendar.SUNDAY) {
		plageHoraireDebut1Indispo = plageHoraireDimancheDebut1Indispo; 
		plageHoraireFin1Indispo = plageHoraireDimancheFin1Indispo;
	} else {
		return true;
	}

	//3. on vrifie le format des paramtres	

	//3.1 plage debut 1
	var debut1Indispo = plageHoraireDebut1Indispo.match(myRegex);

	var debutHeure1Indispo;
	var debutMinute1Indispo;
    
    if (debut1Indispo != null) {
    	//Trace.debug ("OK "+ debut1Indispo[1] + ":" + debut1Indispo[2]);
    	debutHeure1Indispo = new java.lang.Integer(debut1Indispo[1]).intValue();
    	debutMinute1Indispo = new java.lang.Integer(debut1Indispo[2]).intValue();
    } else {
    	return false;
    }

	//3.2 plage fin 1
    var fin1Indispo = plageHoraireFin1Indispo.match(myRegex);

	var finHeure1Indispo;
	var finMinute1Indispo;
    
    if (fin1Indispo != null) {
    	//Trace.debug ("OK "+ fin1Indispo[1] + ":" + fin1Indispo[2]);
    	finHeure1Indispo = new java.lang.Integer(fin1Indispo[1]).intValue();
    	finMinute1Indispo = new java.lang.Integer(fin1Indispo[2]).intValue();
    } else {
    	return false;
    }
   
    // 4. on vrifie si le flux n'est pas dans la plage horaire interdite
    
    //4.1 conversion de la plage horaire de dbut 1 en minute
    var debut1IndispoMIN = (debutHeure1Indispo * 60) + debutMinute1Indispo;
    //Trace.debug ("debut1IndispoMIN : " + debut1IndispoMIN);
    
    //4.2 conversion de la plage horaire de fin 1 en minute
    var fin1IndispoMIN = (finHeure1Indispo * 60) + finMinute1Indispo;
	//Trace.debug ("fin1IndispoMIN : " + fin1IndispoMIN);

	//4.5 comparaison  la date systme
	var heureCouranteMIN = (calNow.get(Calendar.HOUR_OF_DAY) * 60) + calNow.get(Calendar.MINUTE);
    //Trace.debug ("heureCouranteMIN : " + heureCouranteMIN);
    
    if ( (heureCouranteMIN > debut1IndispoMIN && heureCouranteMIN < fin1IndispoMIN) ) {
            return false;
    } else {            
    	return true;   	
    }
    
}

