importPackage(Packages.com.vordel.jose.*);
importPackage(Packages.com.vordel.jose.crypto.*);
importPackage(Packages.com.vordel.jose.jwt.*);
importPackage(Packages.java.security);
importPackage(Packages.com.vordel.trace);
importPackage(Packages.java.util);
importPackage(Packages.com.vordel.common.base64.*);
importPackage(org.apache.commons.codec.binary.*);

function invoke(msg)         
{        
	//Algorithm.HS256
	var headerJWT =  "ew0KICAiYWxnIjogIkhTMjU2IiwNCiAgInR5cCI6ICJKV1QiDQp9DQo=";
	var dataJWT = msg.get("jwt.token.backend");

	//On encode en base64 le payload
	var base64EncodedData = com.vordel.common.base64.Encoder.encodeNoLineBreaks(dataJWT.getBytes());

	var data =  new java.lang.String ( headerJWT + "." + base64EncodedData) ;

	//Extraction de la secret key associe au SPS 
	var secretKey = new java.lang.String(msg.get("jwt.secret.key"));
	var secretHmac = new com.vordel.jose.crypto.HmacSHA256Signer(secretKey.trim().getBytes());

	var signature = secretHmac.sign( data.getBytes());	
	signature = org.apache.commons.codec.binary.Base64.encodeBase64URLSafeString(signature )

	msg.put("jwt.token.signed", data + "." +signature );

	return true;        
}

importPackage(Packages.java.security);
importPackage(Packages.com.vordel.trace);
importPackage(Packages.java.util);
importPackage(org.apache.commons.codec.binary.*);
importPackage (java.security.*);
importPackage (java.security.spec.*);
importPackage (com.vordel.jose.crypto.*);

function invoke(msg)         
{       
   try{
	//On rcupre la cl publique du certificat et le header http-signature
	var certificate= msg.get("certificate");
	var signatureHeader= msg.get("params.header.Signature");
	var paramsHeader= msg.get("params.in.header");
	var contentHeaders= msg.get("http.content.headers");
	var method=msg.get("http.request.method");
	var uri =msg.get("http.request.rawURI");
	
	Trace.debug("certificate :"+certificate );

	if (certificate  != null && certificate  !='') {

		var publicKey = certificate.getPublicKey();
		var algo= publicKey.getAlgorithm();
		var format= publicKey.getFormat();
		Trace.debug("algo :"+algo );
		Trace.debug("format :"+format );
		Trace.debug("signatureHeader:"+signatureHeader );
		var signatureSplit= signatureHeader.replace('"','').split(",");
		var maMap = new Object();
		for ( i =0 ; i <signatureSplit.length ; i++) {
		   var mapkey=signatureSplit[i];
		   var mapkeySplit=mapkey.split("=");
		   var key= mapkeySplit[0];
		   var value=  mapkeySplit[1];
		   maMap[key] = value;			
		}


		for(var key in maMap ){
 	  		Trace.debug('key is :' + key + ' and value is : '+ maMap [key]);
		}

		var headersString = maMap ['headers'];
		var headersList = new java.util.ArrayList();

		var headersStringSplit= headersString.toLowerCase().split(" +");
		var dataToSign= new java.lang.String("");
		for ( i =0 ; i <headersStringSplit.length ; i++) {
		    var key = headersStringSplit[i];		    
		    if ("(request-target)".equals(key)) {
			dataToSign = new java.lang.String(dataToSign +" (request-target):"+" "+ method+" "+ uri +"\n");
		   }
		   else{
			var value = paramsHeader.get(headersStringSplit[i]);
			if(value  == null){
				value = contentHeaders.get(headersStringSplit[i]);
			}
			dataToSign= new java.lang.String(dataToSign + key + ": " + value+"\n");
		   }				
		}	
	
		Trace.debug("dataToSign  :"+dataToSign  );

		var signature=maMap ['signature'];
	   	signature=new java.lang.String(signature+"==");
	
		Trace.debug("requestSignature   :"+ signature );
		
		// code a supprimer 
		var kf = java.security.KeyFactory.getInstance("RSA");
		
      		var privateEncryptedKeyContent="";

		var password= new java.lang.String("password");
		var passKeySpec = new javax.crypto.spec.PBEKeySpec(password.toCharArray());

     	var encryptedKey = new javax.crypto.EncryptedPrivateKeyInfo(Base64.getDecoder().decode(privateEncryptedKeyContent));
       	Trace.debug("encryptedKey.getAlgName(): " +  encryptedKey.getAlgName());
       	
		var keyFac = javax.crypto.SecretKeyFactory.getInstance(encryptedKey.getAlgName());//PBES2
        var passKey = keyFac.generateSecret(passKeySpec);

        // Create PBE Cipher
        var pbeCipher = javax.crypto.Cipher.getInstance(encryptedKey.getAlgName());
        // Initialize PBE Cipher with key and parameters
	    pbeCipher.init(javax.crypto.Cipher.DECRYPT_MODE, passKey, encryptedKey.getAlgParameters());

		var privateKeyBytes =  pbeCipher.doFinal(encryptedKey.getEncryptedData())
		var privateKey = kf.generatePrivate(new  java.security.spec.PKCS8EncodedKeySpec(privateKeyBytes));

		sha256signer =new com.vordel.jose.crypto.RsaSHA256Signer(privateKey);
  	       var mySignature = sha256signer.sign(dataToSign.getBytes() );

		Trace.debug("signDataWithMyCert   :"+ new java.lang.String( Base64.getEncoder().encode(mySignature ))  );

		
		sha256verifier =new com.vordel.jose.crypto.RsaSHA256Verifier(publicKey  );
	    	sha256verifier.verifySignature(dataToSign.getBytes() , Base64.getDecoder().decode(signature) );		

		Trace.debug("Signature Verification OK");

		return true;

	}
	else{
		// Pas de certificat dans la requete
		return false
	} 
 } 
  catch (exp){
	Trace.error(exp);
	return false;		
 }
     
}

